<script>
    showTime();
    function showTime() {
        myDate = new Date();
        days = myDate.getDate();
        month = myDate.getMonth() + 1;
        hours = myDate.getHours();
        minutes = myDate.getMinutes();
        seconds = myDate.getSeconds();
        if (days < 10) days = ""0"" + days;
        if (hours < 10) hours = 0 + hours;
        if (hours < 10) month = ""0"" + hours;
