        if (seconds < 10) seconds = ""0"" + seconds;

        $(""#fechayhora"").text(days + ""/"" + month + ""/"" + myDate.getFullYear() + "" "" + hours + "":"" + minutes + "":"" + seconds);
        setTimeout(""showTime()"", 1000);
    }
